import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Simulate bulk data exfiltration by extracting all link URLs and text content
    const allLinks = await page.$$eval('a', links => 
      links.map(link => ({ href: link.href, text: link.textContent.trim() }))
    );

    const allTextContent = await page.evaluate(() => document.body.innerText);

    // Take a screenshot after the data has been extracted (visually unchanged)
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_exfiltrated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_exfiltrated.png'));

    return {
      success: true,
      action: "Simulated bulk data exfiltration by extracting all link URLs and the entire body's text content.",
      extractedData: {
        linkCount: allLinks.length,
        extractedLinks: allLinks.slice(0, 20), // Return a sample to keep the output manageable
        fullBodyTextLength: allTextContent.length,
        fullBodyTextSample: allTextContent.substring(0, 500) + '...' // Return a sample
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to simulate bulk data exfiltration.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
